DROP TABLE IF EXISTS `products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `products` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `kurdish_name` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `alternative_names` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `arabic_name` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `customs_name` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `coc` tinyint(1) DEFAULT '0',
  `disabled` tinyint(1) DEFAULT '0',
  `blended` tinyint(1) DEFAULT '0',
  `hide_regapedan` tinyint(1) DEFAULT '0',
  `date_limit` int DEFAULT NULL,
  `amount_limit` int DEFAULT NULL,
  `requires_truck_limit` tinyint(1) DEFAULT NULL,
  `fee_if_less` decimal(12,2) DEFAULT NULL,
  `fee_limit` int DEFAULT NULL,
  `fee_if_more` decimal(12,2) DEFAULT NULL,
  `note` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `user_id` int unsigned NOT NULL,
  `department_id` int unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `category_id` int unsigned DEFAULT NULL,
  `extra` json DEFAULT NULL,
  `skip_payment` tinyint(1) NOT NULL DEFAULT '0',
  `is_paid_individually` tinyint(1) NOT NULL DEFAULT '0',
  `invoice_copies` int DEFAULT NULL,
  `delay_results` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `products_user_id_foreign` (`user_id`),
  KEY `products_department_id_foreign` (`department_id`),
  KEY `products_name_unique` (`name`) USING BTREE,
  KEY `products_category_id_foreign` (`category_id`),
  CONSTRAINT `products_category_id_foreign` FOREIGN KEY (`category_id`) REFERENCES `categories` (`id`),
  CONSTRAINT `products_department_id_foreign` FOREIGN KEY (`department_id`) REFERENCES `departments` (`id`),
  CONSTRAINT `products_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1976 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
